/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function(s) {
    let list = [];
    let max = 0;
    let lj=0;
    for(let i=0; i<s.length;){
        let c;
        for(let j=i; j<s.length;j++){
            c = s[j];
            lj++;
            if(list.indexOf(c)==-1){
                list.push(c);
            } else {
                break;
            }
        }
        let index = list.indexOf(c);
        i += index>0?index:1;
        let len = list.length;
        if(max<len) max = len;
        list = [];
    };
    return max
};

